import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <img src="snapcodelogo.png" alt="Snap Code Logo" style={{ width: '100vw', height: 'auto' }} />
        <nav>
          <div className="nav-section left">
            <button>Features</button>
            <button>Pricing</button>
          </div>
          <div className="nav-section center">
            <button>Login</button>
          </div>
          <div className="nav-section right">
            <button>Join Waitlist</button>
          </div>
        </nav>
      </header>
    </div>
  );
}

export default App;
